import {CroctProvider} from '@croct/plug-react'
function OnBoardingPage(props) {
  return <h1>Hello, {props.name}</h1>
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000."> 
    <OnBoardingPage name="Mayara"/>
    </CroctProvider>
  );
}

export default App;
